  return (
    <div className="App">
      <div className="global-container">
        <div className="video-container">
          <video src="/video.mp4" autoPlay muted loop />
        </div>
        <Stage width={window.innerWidth} height={window.innerHeight} />
      </div>
    </div>
  );
}

export default App;
